import Diagram from "../Diagram/Diagram";

function CostsDiagram(props) {
  const diagramDataSets = [
    { label: "Jan", value: 0 },
    { label: "Fed", value: 0 },
    { label: "Mar", value: 0 },
    { label: "Apr", value: 0 },
    { label: "May", value: 0 },
    { label: "Jun", value: 0 },
    { label: "Jul", value: 0 },
    { label: "Ang", value: 0 },
    { label: "Sep", value: 0 },
    { label: "Oct", value: 0 },
    { label: "Nov", value: 0 },
    { label: "Dec", value: 0 },
  ];

  for (const cost of props.costs) {
    const costMonth = cost.date.getMonth();
    diagramDataSets[costMonth].value += cost.amount;
    console.log(c);
  }

  return <Diagram dataSets={diagramDataSets} />;
}

export default CostsDiagram;
